import React from "react";

function Nav () {
    return (
        <nav id="navbar">
            <a href="#home">
                Home
            </a>
            <a href="#about">
                About me
            </a>
            <a href="#projects">
                My Projects
            </a>
            <a href="#contact">
                Contact me
            </a>
        </nav>  
    );
}

export default Nav;
